import React from "react";
import { Box } from "@mui/material";
import ChatHeader from "./ChatHeader";

const ChatBox=()=>{
    return (
        <Box>
            <Box>
                <ChatHeader />
            </Box>
        </Box>
    );
}

export default ChatBox;
